import React from 'react'

function InfoTile({ imgUrl, location }) {
    return (
        <div className='m-2'>
            <div className="relative bg-slate-600 max-w-xl flex flex-col items-center p-3 text-stone-20
                    cursor-pointer hover:bg-header-primary hover:scale-105 transition transform duration-200 ease-in-out">
                <img className='w-full h-80 object-cover' alt='img-location' src={imgUrl} />
                <h1 className="absolute">{location}</h1>
            </div>
        </div>
    )
}

export default InfoTile
